import React, {Component} from 'react';
import { Row, Col } from 'antd';

class Uppermiddle extends Component {
    render() {
        return (
            <uppermiddle className="Uppermiddle">
                This is footer
            </uppermiddle>
        );
    }
}

export default Uppermiddle;
